  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Shiawassee
  National Wildlife Refuge summarizes Refuge activities during the 2005 fiscal year.
  \ The report begins with an introduction to the Refuge and a summary of the yearu2019s
  highlights and climatic conditions.  Information about monitoring and studies- including
  surveys and censuses- is provided next.  Habitat restoration and management projects
  are also covered; activities include wetland restoration, water level management,
  moist soil management, farming, timber management, fire management, and vegetation
  control.  Fish and wildlife management is discussed next with emphasis on bird banding,
  disease monitoring, and nest structures.  Coordination activities, such as interagency
  coordination and private land activities, are outlined.  The resource protection
  section provides information about law enforcement, permits, contaminant investigation,
  contaminant cleanup, and cultural resource management.  Information about public
  education and recreation is given including visitor services and outreach.  Finally,
  Refuge planning and administration are discussed.  Michigan Islands NWR- administered
  by Shiawassee NWR- is summarized at the end. Refuge newsletters and brochures are
  attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
